import { useRef, useEffect } from 'react';
import $ from 'jquery';


function ArrangementTable(props) {
  const tableRef = useRef(null);

  useEffect(() => {
    $(tableRef.current).DataTable();
  }, [tableRef]);

  return (
    <div className="card mb-4">
      <div className="card-header">
        <i className="fas fa-table me-1"></i>
        Arrangements
      </div>
      <div className="card-body">
        <div className="table-responsive">
          <table className="table" id="dataTable" ref={tableRef}>
            <thead>
              <tr>
                <th>ID</th>
                <th>Name</th>
                <th>Description</th>
                <th>Quantity</th>
                <th>Price</th>
                <th>URL</th>
                <th>Category ID</th>
                <th>Flower ID</th>
              </tr>
            </thead>
            <tbody>
              {props.arrangements.map((arrangement) => (
                <tr key={arrangement.arrangement_id}>
                  <td>{arrangement.arrangement_id}</td>
                  <td>{arrangement.name}</td>
                  <td>{arrangement.description}</td>
                  <td>{arrangement.quantity}</td>
                  <td>{arrangement.price}</td>
                  <td>{arrangement.url}</td>
                  <td>{arrangement.category_id}</td>
                  <td>{arrangement.flower_id}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default ArrangementTable;
